import React from "react";

import { ChakraProvider, extendTheme } from '@chakra-ui/react';

export default function App() {

  const colors = {
    brand: {
      900: "#1a365d",
      800: "#153e75",
      700: "#2a69ac",
    },
  }
  const theme = extendTheme({ colors });

  return (
    <ChakraProvider theme={theme}>
      <h1>Teste</h1>
    </ChakraProvider>
  );
}
